let _markdown = "\n\nQuick Start [#quick-start]\n\nThis guide walks you through the first-time setup of a LinkDen instance. If you have not yet installed LinkDen, see the [Installation](/docs/getting-started/installation) guide first.\n\n***\n\n1. Run the Setup Wizard [#1-run-the-setup-wizard]\n\nNavigate to `/admin/setup` on your LinkDen instance (e.g., `http://localhost:3001/admin/setup`).\n\nThe setup wizard walks you through 4 steps:\n\nStep 1: Account [#step-1-account]\n\nCreate your admin account with Better Auth (email/password):\n\n* **Name** -- Your display name (required).\n* **Email** -- Your email address for sign-in (required).\n* **Password** -- Minimum 8 characters (required).\n\nStep 2: Profile [#step-2-profile]\n\nSet up your public profile:\n\n* **Bio** -- A short tagline or description (optional).\n* **Avatar URL** -- URL to your profile image (optional).\n\nBoth fields can be skipped and configured later in settings.\n\nStep 3: Theme [#step-3-theme]\n\nChoose a theme preset from the 7 available themes. Each theme is shown as a card with two color swatches. Click any theme to select it.\n\nStep 4: Done [#step-4-done]\n\nA confirmation screen with a \"Go to Builder\" button that redirects to `/admin/builder`.\n\n***\n\n2. Add Your First Blocks [#2-add-your-first-blocks]\n\nThe block builder at `/admin/builder` uses a two-panel layout:\n\n* **Left panel** -- Your block list with an \"Add Block\" dropdown button.\n* **Right panel** -- A live phone preview (visible on larger screens).\n\nClick **Add Block** to see the 5 block types:\n\n| Block Type       | Description                                           |\n| ---------------- | ----------------------------------------------------- |\n| **Link**         | A clickable button linking to an external URL         |\n| **Header**       | A text heading to group or label sections             |\n| **Social Icons** | A row of social media icon links                      |\n| **Embed**        | Embed YouTube, Spotify, SoundCloud, or custom content |\n| **Contact Form** | A contact form for visitors to message you            |\n\nAdding a Link [#adding-a-link]\n\n1. Click **Add Block** and select **Link**.\n2. In the edit panel that slides in, fill in:\n   * **Title** -- The text shown on the button (e.g., \"My Website\").\n   * **URL** -- The destination URL.\n3. Use the **Style** tab to configure icon, colors, border, and animation.\n4. Use the **Schedule** tab to set start/end dates for time-limited visibility.\n5. Click **Save Changes**.\n\nReordering Blocks [#reordering-blocks]\n\nDrag any block in the list using the grip handle to reorder. The order updates immediately via the `blocks.reorder` mutation.\n\n***\n\n3. Manage Social Icons [#3-manage-social-icons]\n\nNavigate to `/admin/social` to toggle which social networks are active. Active networks become available for use in **Social Icons** blocks. Search by name or filter to see only active networks.\n\n***\n\n4. Configure Settings [#4-configure-settings]\n\nNavigate to `/admin/settings` to configure your instance:\n\n* **Profile** -- Display name, avatar, bio.\n* **SEO** -- Page title, meta description, OG image.\n* **Contact Form** -- Enable/disable, delivery mode (database only, email notification, or both).\n* **CAPTCHA** -- Provider (none, Cloudflare Turnstile, Google reCAPTCHA) with site key and secret key.\n* **Email** -- Provider (Resend or Cloudflare Email Workers), API key, from address.\n* **Export / Import** -- Backup and restore data as JSON.\n* **About** -- Current version and update check.\n\nVisual settings like themes, banner, verified badge, and branding are configured on the [Appearance](/docs/guide/appearance) page at `/admin/appearance`.\n\n***\n\n5. View Your Public Page [#5-view-your-public-page]\n\nClick **View Page** in the dashboard header (or navigate to your domain root) to see your live public link page.\n\nShare this URL as your link-in-bio across social media profiles.\n\n***\n\nNext Steps [#next-steps]\n\n| Topic                         | Link                                           |\n| ----------------------------- | ---------------------------------------------- |\n| Block types and configuration | [Blocks](/docs/guide/blocks)                   |\n| Themes, colors, and branding  | [Appearance](/docs/guide/appearance)           |\n| Social network icons          | [Social Networks](/docs/guide/social-networks) |\n| Apple Wallet business card    | [Apple Wallet](/docs/guide/apple-wallet)       |\n| Contact form setup            | [Contact Form](/docs/guide/contact-form)       |\n| Analytics                     | [Analytics](/docs/guide/analytics)             |\n| vCard digital business card   | [vCard](/docs/guide/vcard)                     |\n";
